import React from "react";
import './Button.css';

const STYLES = [
    
    "btn--primary--solid",
    "btn--warmomg--solid",
    "btn--danger--solid",
    "btn--success--solid",
    "btn--primary--outline",
    "btn--warmomg--outline",
    "btn--danger--outline",
    "btn--success--outline",

]

export const Button = ({children,type,onClick,buttonStyle,buttonSize}) =>{
    return(
        <button onClick={onClick} type={type}>
            {children}
        </button>
    )
}
